    return <Container className="mt-5 text-center">
        <div className="mt-5">
            <p className="text-muted"><small>Website design Â© 2020 by <a href="http://www.coletaylor.tk" target="_blank" rel="noopener noreferrer">Cole Taylor</a></small></p>
        </div>
    </Container>
}
